"""This module is a collection of extracted vectors of dimension and some
utilities to help tests build more realistic broker messages.

"""

import itertools

from nucliadb.common import datamanagers
from nucliadb_protos.writer_pb2 import BrokerMessage, ExtractedVectorsWrapper


async def adjust_kb_vectorsets(kbid: str, bm: BrokerMessage):
    """In order to build more realistic broker messages, we use a real
    environment to generate processing messages. However, the vectorset of the
    KB may not match with the ones in the tests

    To avoid ingest to drop the original and leave us without vectors in the
    tests, this function copies and shrinks/expands vectors to match each
    vectorset existing in the KB.

    Note this function updates the broker message in place

    """
    new = []
    async with datamanagers.with_ro_transaction() as txn:
        async for vectorset_id, vs in datamanagers.vectorsets.iter(txn, kbid=kbid):
            for field_vectors in bm.field_vectors:
                ev = ExtractedVectorsWrapper()
                ev.CopyFrom(field_vectors)

                ev.vectorset_id = vectorset_id

                for vectors in itertools.chain([ev.vectors.vectors], ev.vectors.split_vectors.values()):
                    for vector in vectors.vectors:
                        original_dimension = len(vector.vector)
                        vectorset_dimension = vs.vectorset_index_config.vector_dimension
                        if vectorset_dimension > original_dimension:
                            vector.vector.extend([0.0] * (vectorset_dimension - original_dimension))
                        elif vectorset_dimension < original_dimension:
                            del vector.vector[vectorset_dimension:]

                new.append(ev)

    bm.ClearField("field_vectors")
    bm.field_vectors.extend(new)


